import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import Home from './components/Home';
import MatchDetails from './components/MatchDetails';
import ScorecardTab from './components/MatchDetails/ScorecardTab';
import Schedule from './components/Schedule';
import Series from './components/Series';
import TeamRankings from './components/TeamRankings';
import News from './components/News';
import Players from './components/Players';
import PlayerDetails from './components/PlayerDetails';
import Stadiums from './components/Stadiums';
import Teams from './components/Teams';
import TeamSeries from './components/TeamSeries';

export default function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/match/:id" element={<MatchDetails />} />
        <Route path="/match/:id/scorecard" element={<ScorecardTab />} />
        <Route path="/schedule" element={<Schedule />} />
        <Route path="/series" element={<Series />} />
        <Route path="/series/:id" element={<Series />} />
        <Route path="/rankings" element={<TeamRankings />} />
        <Route path="/news" element={<News />} />
        <Route path="/player" element={<Players />} />
        <Route path="/player/:id" element={<PlayerDetails />} />
        <Route path="/stadiums" element={<Stadiums />} />
        <Route path="/teams" element={<Teams />} />
        <Route path="/teams/:teamName/series" element={<TeamSeries />} />
      </Routes>
    </Router>
  );
}
